#include <stdio.h>
#include <stdlib.h>
#include <string.h>

int sunday(char* src,char* target)
{
    int src_len = (int)strlen(src);
    int target_len = (int)strlen(target);
    //模式串大于源
    if (target_len > src_len) return -1;
    //建立模式串缓存
    char buffer[255];
    for (int i = 0; i < 255; ++i) buffer[i] = -1;
    for (int i = 0; i < target_len; ++i) buffer[target[i]] = i;
    for (int i = 0; i < src_len;)
    {
        int k = 0,i_next,match_idx,i_bak = i;
        while (i < src_len && k < target_len && src[i] == target[k]) {++i;++k;}
        if (k == target_len) return i - target_len;
        i_next = i + (target_len - k);
        if (i_next >= src_len) return -1;
        match_idx = buffer[src[i_next]];
        i_bak += target_len - match_idx;
        i = i_bak;
        k = 0;
    }
    return -1;
}

int main_sunday(void)
{
    // "aabaabbbaabbbbabaaab"
    // "abaa"
    int res = sunday("","");
    printf("%d\n",res);
    return 0;
}
